import { Link } from "react-router-dom";

export default function Test() {

    const [counter, setCounter] = useState(0);
    console.log(setCounter)
  function Hello() {
    return <h1>This is test message</h1>;
  }

  const Increment = () => {
        setCounter(counter + 1)
  }
  return (
    <>
      <div className="flex flex-row  border-8 solid border-red-500">
        <div className="border-8 solid text-center grow">1</div>
        <div className="border-8 solid text-center grow-[2]">2</div>
        <div className="border-8 solid text-center grow-[3]">3</div>
      </div>
        {counter} <button onClick={Increment}>Increment</button>
        <hr/>
      <Link to="/e" state={{ func1: "a" }}>
        Go to the new page
      </Link>
    </>
  );
}
